import React from 'react';
import HeaderNike from './headerNIke';
import './nike.css';
import MainNike from './mainNike';

function NikeApp(props) {
  return (
    <div>
      <HeaderNike />
      <div className="strip container-fluid">
      </div>
      <MainNike />
    </div>
  )
}

export default NikeApp
